/** @format */

import styled from "styled-components";
import Section from "./Section";

function Home() {
  return (
    <Container>
      <Section
        title="Model S"
        description=""
        backgroundImg="model-s.jpg"
        leftBtnText="Custom order"
        rightBtnText="Existing Inventory"
      />
      {/* <Section /> */}
    </Container>
  );
}

export default Home;

const Container = styled.div`
  height: 100vh;
`;
